import React from 'react';
import styled from 'styled-components';

const TopLine = styled.div``;

const MidLine = styled.div``;

const BotLine = styled.div``;

const BurgerIconStyled = styled.div``;

function BurgerIcon() {
	return (
		<BurgerIconStyled>
			<TopLine />
			<MidLine />
			<BotLine />
		</BurgerIconStyled>
	);
}

export default BurgerIcon;
